import React from 'react';
import classes from './Tittle.module.css'

const Tittle = () => {
  return (
    <div className={classes.tittle_wrapper}>
      <a href={'https://en.wikipedia.org/wiki/Pomodoro_Technique'} value={'Pomodoro таймер'}>
      Pomodoro таймер
      </a>
    </div>
  );
};

export default Tittle;
